stateMachine.definition:
{
  "Comment": "A description of my state machine",
  "StartAt": "Lambda 1 - serializeImageData",
  "States": {
    "Lambda 1 - serializeImageData": {
      "Type": "Task",
      "Resource": "arn:aws:states:::lambda:invoke",
      "OutputPath": "$.Payload",
      "Parameters": {
        "Payload.$": "$",
        "FunctionName": "arn:aws:lambda:us-east-1:543487266235:function:lambda1_serializeImageData:$LATEST"
      },
      "Next": "Lambda 2 - imageClassifier"
    },
    "Lambda 2 - imageClassifier": {
      "Type": "Task",
      "Resource": "arn:aws:states:::lambda:invoke",
      "OutputPath": "$.Payload",
      "Parameters": {
        "Payload.$": "$",
        "FunctionName": "arn:aws:lambda:us-east-1:543487266235:function:lambda2_imageClassifier:$LATEST"
      },
      "Next": "Lambda 3 - inferenceConfidenceFilter",
      "InputPath": "$.body"
    },
    "Lambda 3 - inferenceConfidenceFilter": {
      "Type": "Task",
      "Resource": "arn:aws:states:::lambda:invoke",
      "OutputPath": "$.Payload",
      "Parameters": {
        "Payload.$": "$",
        "FunctionName": "arn:aws:lambda:us-east-1:543487266235:function:lambda3_inferenceConfidenceFilter:$LATEST"
      },
      "End": true,
      "InputPath": "$.body"
    }
  }
}
